import React from 'react';
import { BottomSection, MainPhoto, MainPhotoContainer, MiddleSection, Title, TopSection, Wrapper } from './components';
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'
import eltonMain from './img/eltonMain.png';
import elton1 from './img/elton1.jpg';

function App() {
  const slideImages = [
    {
      url: eltonMain,
    },
    {
      url: elton1,
    },
    {
      url: eltonMain,
    },
  ];

  return (
    <Wrapper>
    <TopSection>
      <Title>
        Adopt Elton
      </Title>
      <Slide>
        {slideImages.map((slideImage, index)=> (
          <div key={index}>
            <MainPhotoContainer style={{  'backgroundImage': `url(${slideImage.url})` }} />  
          </div> 
        ))} 
        </Slide>
    </TopSection>
    <MiddleSection>

    </MiddleSection>
    <BottomSection>
    </BottomSection>
    </Wrapper>
  );
}

export default App;
